import logo from "./logo.svg";
import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      name: "Ahmad",
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>hello {this.state.name}</p>
          <button
            onClick={() => {
              this.setState({ name: "Hamza" });
            }}
          >
            Click
          </button>
        </header>
      </div>
    );
  }
}

export default App;
